import React from 'react';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

import Student from './pages/Student';

function App() {
  return (
    <Router>
      <Route exact path='/' component={Student}/>
    </Router>
  );
}

export default App;
